import '../styles/circle.css';

export function BigCircle() {
    return (
        <div className="circle big"></div>
    )
}

export function MiddleCircle() {
    return (
        <div className="circle middle"></div>
    )
}

export function SmallCircle() {
    return (
        <div className="circle small"></div>
    )
}
